import bvcard from '../img/romance/blue-valentine/bvcard.jpg'

const romance = [asibcard, bvcard]

export default function Card2() {

    return (
        
        <div className = "cards">        
            
            <div className ="card2">
                
                <div className="cardImage">
                    {  
                        romance.map(img => (
                            <ContentBlock>
                            
                            </ContentBlock>
                        ))
                    }
                </div> 

            </div>
        </div>    
            

        

        
    )
}
